function HelmetResumen( props ) {
	return (
		<Helmet>
			{/* <meta charSet="utf-8" /> */}
			<title>PRACTICE REACT - { props.title }</title>
			{/* <link rel="canonical" href="http://mysite.com/example" /> */}
		</Helmet>
	);
}

